To Whom It May Concern:

Pursuant to the California Public Records Act, I hereby request the following records:

Records that identify equipment grants to law enforcement agencies within the area in which your Urban Areas Security Initiative (UASI) authority operates, approved since January 1, 2016, including grant application if available, that contain some or all of the following information:

Name of recipient or sub-recipient;
City or County of recipient/sub-recipient;
Summary description of equipment for which the grant was intended;
Dollar amount or value of grant, award, or sub-award;
Fiscal Year of federal funds from which grant originated;
Time period in which grant was to be executed.

The information we have received from the California Office of Emergency Services indicates that the following serve as UASI authorities or administrators within California:
Bay Area UASI; 
City of Los Angeles; 
City of Santa Ana, Homeland Security Division; 
City of San Diego, Office of Homeland Security; 
City of Riverside Office of Emergency Management; 
Sacramento Police Department.

Please disclose records as they become available to you. If you determine that any or all of the information in responsive records is exempt from disclosure, I request that: (1) you exercise your discretion to disclose some or all of the records notwithstanding the exemption; and (2) that, with respect to records containing both exempt and non-exempt content, you redact the exempt content and disclose the rest.

If you have questions to clarify this request, you may contact me directly at 510-282-8983 or via email at jlindsay-poland@afsc.org.

The requested documents will be made available to the general public, and this request is not being made for commercial purposes.

In the event that there are fees, I would be grateful if you would inform me of the total charges in advance of fulfilling my request. I would prefer the request filled electronically, by e-mail attachment if available or CD-ROM if not.

Thank you in advance for your anticipated cooperation in this matter. I look forward to receiving your response to this request within 10 calendar days, as the statute requires.

Sincerely,

John Lindsay-Poland
